script: |
  super -f text -I q11667.spq | sort > q11667.out

inputs:
  - name: q11667.spq
    data: |
      SELECT DISTINCT * FROM tab1 (FORMAT parquet) WHERE NOT col2 BETWEEN 6 + + - col0 + - col0 AND + col1 * + + col2 + - + col0 - + + 60 / + col1 + 85 + - + 70 - col1;
  - name: tab1

outputs:
  - name: q11667.out
    data: |
